import React, { useEffect, useState } from 'react';
import APIClient from '../api/api';
import './LogsTable.css';

export default function LogsTable() {
  const [logs, setLogs] = useState([]);

  useEffect(() => {
    APIClient.get('/logs')
      .then(res => {
        const rawLogs = res.data;
        return APIClient.post('/detect-anomalies', rawLogs);
      })
      .then(res => {
        const anomalies = res.data.filter(log => log.anomaly === true);
        setLogs(res.data);
      })
      .catch(err => console.error(err));
  }, []);

  return (
    <div>
      <h2>Anomalous Logs</h2>
      {logs.length === 0 ? (
        <p>No anomalies found.</p>
      ) : (
        <table className="logs-table">
          <thead>
            <tr>
              {logs[0] && Object.keys(logs[0]).map((key, idx) => (
                <th key={idx}>{key}</th>
              ))}
            </tr>
          </thead>
          <tbody>
            {logs.map((log, idx) => (
              <tr key={idx} className="anomaly-row">
                {Object.values(log).map((val, i) => (
                  <td key={i}>{val}</td>
                ))}
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}
